                  { cuerpo.map(per => {
                      return( <div  className='col'>
                          <div  className='card'>
                              <img src={cuerpo.image} alt="" />
                              <h5 className=' mt-2'>
                                  Nombre: {cuerpo.name}
                              </h5>
                              <h5>
                                  Especie: {cuerpo.species}
                              </h5>
                                <h5>
                                    
                                </h5>
                              
